import React from "react";
import "./Title.css";
import hamburgerIcon from "../../images/hamburgerIcon.png";

const Title = ({ titleText }) => {
  return (
    <div className="title-text title-div">
      <img src={hamburgerIcon} />
      <div>{titleText}</div>
    </div>
  );
};

export default Title;
